
CREATE TABLE IF NOT EXISTS transacoes_financeiras (
    id SERIAL PRIMARY KEY,
    apostador_id VARCHAR(50),
    valor NUMERIC,
    tipo VARCHAR(20),
    data TIMESTAMP
);


CREATE TABLE IF NOT EXISTS apostas (
    aposta_id VARCHAR(50) PRIMARY KEY,
    apostador_id VARCHAR(50),
    jogo_id VARCHAR(50),
    valor NUMERIC,
    odd NUMERIC,
    timestamp TIMESTAMP,
    resultado VARCHAR(20)
);


